import React, { useState } from "react";

const defaultForm = {
  email: "",
  fullName: "",
  age: "",
  education: "",
  institute: "",
  program: "",
  experience: "",
  canadaInstitute: "",
  canadaProgram: "",
  coutry: "",
  goals: "",
  scoresListening: "",
  scoresReading: "",
  scoresSpeaking: "",
  scoresWriting: "",
  isPaidTutionFees: null,
  paidTutionAmount: "",
  isGic: null,
  paidGicAmout: "",
};

function InputField() {
  const [value, setValue] = useState();

  return (
    <div>
      <label></label>
      <input></input>
    </div>
  );
}

function SelectField() {}
export default function Form() {
  const [form, setForm] = useState(defaultForm);
  return (
    <div>
      <form></form>
    </div>
  );
}
